import React from 'react';

function PopupForm({ isOpen, onClose, onSubmit, initialValues }) {
    const handleSubmit = (e) => {
        e.preventDefault();
        onSubmit();
    };

    return (
        isOpen && (
            <div className="form-popup">
                <form onSubmit={handleSubmit} className="form-container">
                    <h2>Popup Form</h2>
                    {/* Ajoutez les champs du formulaire ici en utilisant les valeurs initiales */}
                    <input type="text" placeholder="Nom d'utilisateur" value={initialValues.username} onChange={(e) => initialValues.setNewPasswordUsername(e.target.value)} />
                    <input type="text" placeholder="Mot de passe" value={initialValues.password} onChange={(e) => initialValues.setNewPasswordPassword(e.target.value)} />
                    <input type="text" placeholder="Site web" value={initialValues.website} onChange={(e) => initialValues.setNewPasswordWebsite(e.target.value)} />
                    {/* Ajoutez d'autres champs ici si n√©cessaire */}
                    <button type="submit" className="btn">Submit</button>
                    <button type="button" className="btn cancel" onClick={onClose}>Close</button>
                </form>
            </div>
        )
    );
}

export default PopupForm;
